import React from 'react'
import { teamsData } from './teams-data'
import '../App.css'

function GradesView() {
    return (
        <>
        <div className="teams-container">
        {teamsData.map((data, key) => {
            return (
                <>
                <div key={key}>
                    {
                        data.teamName + " | Grade: " + data.grade
                    }
                </div>
                 
                 </>
            )
        })}
        
    </div>
    <br/>

</>
    )
}

export default GradesView
